import React, { Component } from "react";
import waterBillLogo from "../img/Ab-o-Fazelab-01.svg";
class WaterBill extends Component {
  state = {};
  render() {
    return (
      <div className="water-bg p-3 col-lg-10">
        <div className="w-100">
          {" "}
          <img src={waterBillLogo} width="70px" alt="" /> شرکت آب و فاضلاب ایران
        </div>
      </div>
    );
  }
}

export default WaterBill;
